query HomePage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    id
    html
    frontmatter {
      title
      image
      announcementBlurb
      announcementLink
      announcementImage
    }
  }
}

query AboutPage(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    id
    html
    frontmatter {
      title
      full_image
      leftBackground
      leftTitle
      leftLink
      rightTitle
      rightDescription
      rightUrl
    }
  }
}

query BlogPostByID(
  $id: String!
) {
  markdownRemark(id: {eq: $id}) {
    id
    html
    frontmatter {
      date(formatString: "MMMM DD, YYYY")
      title
      description
      tags
      header
      recommendedName
      recommendedImage
      recommendedLink
    }
  }
}

query IndexQuery {
  allMarkdownRemark(sort: {order: DESC, fields: [frontmatter___date]}, filter: {frontmatter: {templateKey: {eq: "blog-post"}}}) {
    edges {
      node {
        excerpt(pruneLength: 100)
        id
        fields {
          slug
        }
        frontmatter {
          title
          templateKey
          header
          description
          date(formatString: "MMMM DD, YYYY")
        }
      }
    }
  }
}

query PortfolioQuery {
  allMarkdownRemark(sort: {order: DESC, fields: [frontmatter___date]}, filter: {frontmatter: {templateKey: {eq: "portfolio"}}}) {
    edges {
      node {
        excerpt(pruneLength: 100)
        id
        fields {
          slug
        }
        frontmatter {
          portfolioDescription
          image
          portfolioName
          portfolioImage
          portfolioPrice
          portfolioLink
          date(formatString: "MMMM DD, YYYY")
        }
      }
    }
  }
}

