query TagPage(
  $tag: String
) {
  site {
    siteMetadata {
      title
    }
  }
  allMarkdownRemark(limit: 1000, sort: {fields: [frontmatter___title], order: ASC}, filter: {frontmatter: {tags: {in: [$tag]}}}) {
    totalCount
    edges {
      node {
        fields {
          slug
        }
        frontmatter {
          title
          header
          date(formatString: "MMMM DD, YYYY")
        }
      }
    }
  }
}

query TagsQuery {
  site {
    siteMetadata {
      title
    }
  }
  allMarkdownRemark(limit: 1000) {
    group(field: frontmatter___tags) {
      fieldValue
      totalCount
    }
  }
}
